('2158','18','7127','Villa Malcolm',Null,'Familienvilla in ruhiger Villenwohnlage Sol de Mallorca','30704','In der Gemeinde Calvia, im Südwesten von Mallorca, steht diese sehr gepflegte Einfamilienvilla auf einem ca 1.500m² großen, flachen Grundstück. Zu den internationalen Schulen oder Golfplätzen sind es nur wenige Fahrminuten.\r\nDie Wohnfläche verteilt sich auf 2 Etagen. Die gepflegte Villa hat 6 Schlafzimmer, 6 Badezimmer, und ein Schlafzimmer mit Badezimmer für Angestellte. Der kinderfreundliche Garten mit Pool ist der ideale Ort für Barbecue Feste mit Freunden zu feiern oder auch zum Chillen und Relaxen.  Die Temperatur  der möblierten Villa wird über die Klimaanlage warm/kalt oder einen Kamin gesteuert. Hochwertige PVC Doppelglasfenster halten die Energiekosten günstig.\r\n\r\n','30705','1795000','106','2014-02-10 11:12:31','106','2014-02-10 11:13:31',Null,'2074','125','982',1,'1','0',Null,Null,Null,'30706',Null,'0','0','0',Null,'2015-11-09 10:09:48',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30707',Null,'30708',Null,'30709',Null,'30710','termin 666556699','30711','0',0,'0');
